import base64

# Dán chuỗi của bạn vào đây
encoded_data = ""

try:
    # Giải mã Base64
    decoded_bytes = base64.b64decode(encoded_data)
    decoded_str = decoded_bytes.decode('utf-8')

    print("➡️ Kết quả sau khi giải mã:")
    print(decoded_str)

except Exception as e:
    print("Lỗi khi giải mã:", e)
